import React from 'react';
import { Link } from 'react-router-dom';
import Main from './Main';
import Footer from './Footer';
import Catal from './catal';
import './Home.css';
// import rs from './Image/rs.png'; //logo image
import logo from './Image/logo.png'; 
import AutoSlider from './AutoSlider';
function Home() {
  return (
    <div>
      <nav>
        <div className="logo-container">
          <img src={logo} alt="RS Engineering Logo" className="logo" />
        </div>
        <h2>RS Engineering</h2>
        <ul className='link'>
          <li>
            <Link to="/" className='Link'>Home</Link>
          </li>
          <li>
            <Link to="/about" className='Link'>About</Link>
          </li>
          <li>
            <Link to="/register" className='Link'>Register</Link>
          </li>
          <li>
            <Link to="/login" className='Link'>Login</Link> 
          </li>
          {/* <li>
            <Link to="/queryform" className='Link'>QueryForm</Link> 
          </li> */}
          <li>
            <Link to="/catal" className='Link' ><Catal/>Catalogue</Link> 
          </li>
        </ul>
      </nav>
      <Main />
      <AutoSlider/>
      <Footer />
    </div>
  );
}

export default Home;
